Il film che vi consiglio oggi è una pellicola del 2007 per la regia di Anton Corbijn ed è "Control". Il film racconta la storia di Ian Curtis, storico frontman dei Joy Division, gruppo punk degli anni settanta, morto suicida il 18 maggio del 1980. Il film, oltre a raccontare la carriera artistica del cantante, va ad approfondire anche la vita privata di Curtis, facendo uscire fuori un ritratto del cantante che fino ad allora nessuno conosceva. Corbijn è riuscito a raccontare con maestria la storia di Curtis mostrando i difetti che aveva il cantante, ma anche il lato tormentato e geniale, raccontando anche dei problemi di epilessia che lo tormentavano fin da ragazzo. Il regista olandese ha voluto mostrare un ragazzo pieno di passione per ciòche faceva, ma che purtroppo non riusciva a sopportare i problemi che lo perseguitavano. Sam Riley, che interpreta il cantante inglese, è stato superlativo e la somiglianza fisica è impressionante. Bravissima anche Samantha Morton, che interpreta la moglie del cantante. In poche parole, vi consiglio assolutamente di guardarlo, anche a chi non è fan dei Joy Division. Fatemi sapere cosa ne pensate, e per altre recensioni seguitemi 😉🎥🎬.
